$(function(){var t=$("#searchBtn"),e=$("#exportBtn"),a=$("#tableSearch");t.click(function(){var t={school:$("#school").val(),major:$("#major").val(),nation:$("#nation").val(),census:$("#census").val(),degree:$("#degree").val(),sex:$("#sex").val(),complete:$("#complete").val()};$.ajax({url:"#",data:t,success:function(t){var e=$.parseJSON(t),c="";a.html("");for(var n=0;n<e.length;n++)c="<tr><td>"+e[n].school+"</td><td>"+e[n].major+"</td><td>"+e[n].nation+"</td><td>"+e[n].census+"</td><td>"+e[n].degree+"</td><td>"+e[n].sex+"</td><td>"+e[n].complete+"</td></tr>",a.append(c)}})}),e.click(function(){})});